const Header = (props) => {
  return (
    <div>
      <h1>Listado Maravillas el mundo</h1>
      <nav>
        <ul>
          <li>Home</li>
          <li>Quienes somos</li>
          <li>Contacto</li>
        </ul>
      </nav>
    </div>
  );
};
export default Header;
